function parsePath (path) {
  if (bailRE.test(path)) {

  var segments = path.split('.');
  return function (obj) {
    for (var i = 0; i < segments.length; i++) {

  var match = fn && fn.toString().match(/^\s*function (\w+)/);
  return match ? match[1] : ''
